window.CHART={INSTANCES:[],RESIZE_OBSERVER:new ResizeObserver(()=>{CHART.INSTANCES.forEach(({chart:n})=>{n.resize()})}),Initialized:(n,t)=>{const i=echarts.init(document.getElementById(`${n}`));i.setOption(JSON.parse(t));CHART.INSTANCES.push({domId:n,chart:i});CHART.RESIZE_OBSERVER.observe(i.getDom())},Dispose:n=>{CHART.RESIZE_OBSERVER.disconnect(CHART.INSTANCES.find(t=>t.domId===n).chart.getDom()),CHART.INSTANCES=CHART.INSTANCES.filter(t=>t.domId!=n)}};